import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { login } from "../actions/userActions";
import { Navigate, Link } from "react-router-dom";

export default function LoginScreen() {
  const dispatch = useDispatch();
  const { userInfo, loading, error } = useSelector((s) => s.userLogin);
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  const submit = (e) => { e.preventDefault(); dispatch(login(username, password)); };
  if (userInfo?.access) return <Navigate to="/" />;

  return (
    <div className="min-vh-100 d-flex align-items-center justify-content-center" style={{ background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)' }}>
      <div className="container">
        <div className="row justify-content-center">
          <div className="col-lg-6 col-md-8">
            <div className="card border-0 shadow-lg" style={{ borderRadius: '15px', backdropFilter: 'blur(10px)', background: 'rgba(255, 255, 255, 0.95)' }}>
              <div className="card-body p-5">
                <div className="text-center mb-4">
                  <div className="logo mb-3" style={{ fontSize: '2.5rem', fontWeight: 'bold', color: '#667eea' }}>EH</div>
                  <h2 className="fw-bold mb-2">Welcome Back</h2>
                  <p className="text-muted">Sign in to your EventHub account</p>
                </div>

                {error && <div className="alert alert-danger" style={{ borderRadius: '10px' }}>{String(error)}</div>}

                <form onSubmit={submit}>
                  <div className="mb-4">
                    <label className="form-label fw-semibold">Username</label>
                    <div className="input-group">
                      <span className="input-group-text" style={{ borderRadius: '10px 0 0 10px' }}>
                        <i className="bi bi-person"></i>
                      </span>
                      <input
                        className="form-control"
                        style={{ borderRadius: '0 10px 10px 0', borderLeft: 'none' }}
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                        required
                        placeholder="Enter your username"
                      />
                    </div>
                  </div>

                  <div className="mb-4">
                    <label className="form-label fw-semibold">Password</label>
                    <div className="input-group">
                      <span className="input-group-text" style={{ borderRadius: '10px 0 0 10px' }}>
                        <i className="bi bi-lock"></i>
                      </span>
                      <input
                        type="password"
                        className="form-control"
                        style={{ borderRadius: '0 10px 10px 0', borderLeft: 'none' }}
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        required
                        placeholder="Enter your password"
                      />
                    </div>
                  </div>

                  <button
                    className="btn btn-primary w-100 py-3"
                    type="submit"
                    disabled={loading}
                    style={{ borderRadius: '10px', fontWeight: '600', background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)', border: 'none' }}
                  >
                    {loading ? (
                      <>
                        <span className="spinner-border spinner-border-sm me-2" role="status" aria-hidden="true"></span>
                        Signing In...
                      </>
                    ) : (
                      'Sign In'
                    )}
                  </button>
                </form>

                <div className="text-center mt-4">
                  <p className="mb-0 text-muted">Don't have an account? <Link to="/register" className="text-decoration-none fw-semibold" style={{ color: '#667eea' }}>Sign up here</Link></p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
